import React, { useState } from "react";

const Plus = () => {

  let getTime = new Date().toLocaleTimeString();
  let [time, currentTime] = useState(getTime)

let curr = () => {
  let cur = new Date().getTime();
  currentTime(cur);
}

  return (
    <div className="container">
      <h1>{time}</h1>
      <button onClick = {curr}>Click Me</button>
    </div>
  );
};

export default Plus;
